●メーカー名：(株)ソフト99コーポレーション　●サイズ/仕様：ホワイト&Wパール車用 ●内容量：750ml。●対応カラー：ホワイト＆ホワイトパール。 ●新開発「高輝度撥水ポリマー」がシャンプーと同時にボディに「輝き被膜」を形成し、ボディカラーを深く鮮やかに発色させます。さらに、強力な撥水性能により雨を弾いて汚れの固着も防止。細かい部分まで隅々まで洗える形状の新開発スポンジ付。 

