●メーカー名：(株)プロスタッフ　●カラー：ライト車 ●内容量：750ml。●対応カラー：ライト車。●付属品：特大スポンジ（黒）x1個。 ●魁 磨き塾シリーズにプロ仕上げのコンパウンドシャンプーが登場。シャンプーするだけで、ボディーに付いた水アカ・くすみ・洗車キズ・ウォータースポット・劣化被膜などをまとめて落とします。超微粒子パウダーが、しつこい汚れを落として塗装面を平滑にし洗車キズを消します。さらに豊富な泡がボディー表面の汚れを包み込んで落とし、ダブルの効果で塗装面をスッキリ仕上げます。また、ワックスやコーティング施工前の下地処理にも最適。下地をキレイにすることで定着性が良くなり、ワックス本来のツヤ・耐久性を引き出します。新車から5年以上。 

