●メーカー名：オカモト産業(株) ●容量：500ml。●付属品：スポンジ付。●全塗装色対応。 ●窓ガラスは雨を弾いて視界を確保する撥水タイプ。●ボディは水がサッと引くように流れ、汚れがこびりつきにくい疎水タイプ。●「ベストコンディショニングシステム」により、洗浄と同時に撥水・疎水ポリマーを窓ガラス、ボディ面に定着させるため、初めて使う方でも常にベストな状態に仕上がります。 【使用方法】●水でうすめず、スポンジに直接液をつけるストレートタイプです。(1)キズの原因となる砂や泥を水で洗い流してください。(2)ボトルをよく振り、水を含ませたスポンジに液をたっぷりとつけ、泡立ててください。(3)スポンジで力をいれずに、すりこむように洗ってください。(4)水で十分にすすいでから、ボディやガラスに残った水滴を拭いてください。

